import React, { useRef, useState, useEffect } from "react";
import { Play, Pause, Volume2, VolumeX, ChevronDown, ChevronUp } from "lucide-react";
import './RadioPlayer.css';

const RadioPlayer = () => {
  const audioRef = useRef(new Audio("https://sonic-us.fhost.cl/8126/stream"));
  const [isPlaying, setIsPlaying] = useState(false);
  const [volume, setVolume] = useState(() => Number(localStorage.getItem("radioVolume")) || 1);
  const [lastVolume, setLastVolume] = useState(volume);
  const [isMuted, setIsMuted] = useState(volume===0);
  const [currentTime, setCurrentTime] = useState(
    new Date().toISOString().substr(14, 5)
  );
  const [collapsed, setCollapsed] = useState(false);

  useEffect(() => {
    audioRef.current.volume = volume;
    localStorage.setItem("radioVolume", volume);
    setIsMuted(volume === 0);
  }, [volume]);

  useEffect(() => {
    const interval = setInterval(() => {
      const time = new Date().toISOString().substr(14, 5);
      setCurrentTime(time);
    }, 1000);
    return () => clearInterval(interval);
  }, []);

  const togglePlay = () => {
    if (!isPlaying) audioRef.current.play();
    else audioRef.current.pause();
    setIsPlaying(!isPlaying);
  };

  const toggleMute = () => {
    if (!isMuted) {
      setLastVolume(volume);
      setVolume(0);
    } else setVolume(lastVolume || 1);
  };

  return (
    <div className={`radio-player-wrapper ${collapsed ? "collapsed" : ""}`}>
      <div className="collapse-btn-wrapper">
        <button className="collapse-btn" onClick={()=>setCollapsed(!collapsed)}>
          {collapsed ? <ChevronUp size={20}/> : <ChevronDown size={20}/>}
        </button>
      </div>

      <div className="radio-player">
        <div className="gradient-left"></div>

        <div className="radio-info">
          <div className={`status-indicator ${isPlaying ? "playing":"paused"}`}></div>
          <div className="radio-details">
            <span className="radio-name">Radio Oriente</span>
            <span className="radio-frequency">FM 98.1</span>
          </div>
        </div>

        <div className="player-controls">
          <button className="control-button" onClick={togglePlay}>
            <span className="control-icon">
              {isPlaying ? <Pause/> : <Play/>}
            </span>
          </button>
          <div className="current-time">{currentTime}</div>
        </div>

        <div className="volume-controls">
          <Volume2 onClick={toggleMute} className="cursor-pointer"/>
          <div className="volume-slider-container">
            <div className={`volume-progress ${isPlaying ? "playing" : ""}`} style={{width:`${volume*100}%`}}></div>
            <div className="volume-thumb"></div>
            <input 
              type="range" 
              className="volume-range" 
              min="0" max="1" step="0.01"
              value={volume}
              onChange={e=>setVolume(Number(e.target.value))}
            />
          </div>
        </div>

        <div className="gradient-right"></div>
      </div>
    </div>
  );
};

export default RadioPlayer;
